2		Les frères Aman et Anthoine Lebrun, menuisiers tourangeaux, ont passé un marché avec Jean Volant, marinier, afin qu’il livre du bois pour l’aménagement du château de Fontainebleau. Il a fait un trajet d’environ deux semaines, en partant de Tours et en remontant la Loire jusqu’au port de Gien.\r\nJean est passé devant de grands châteaux de la Loire, tels que: Amboise, Chaumont-sur-Loire et Blois. Il a également traversé Orléans avant de rejoindre le port de Gien, qui fut son dernier arrêt sur la Loire avant de remonter vers le château de Fontainebleau.	Marché conclu par Aman Lebrun et son frère Anthoine Lebrun, tous deux menuisiers à Tours, avec Jean Volant, marinier demeurant sur l’île Saint-Jacques, pour la conduite sous quinzaine, jusqu’au port de Gien, de huit milliers d’ouvrage de menuiserie et d’un barillet de pruneaux destinés à l’aménagement du château de Fontainebleau, moyennant 27 s. 6 d.t. par millier, dont 8 l.t. furent avancés au marinier, en présence des témoins Guillaume Jolly, tisserand, et Pierre Noyau.	6	5
4		Jean Fournier, marinier à la Riche, doit livrer des pierres de Bourré. On les appelle également pierres de tuffeau. Ces pierres ont permis la construction des plus grands et beaux châteaux de la Loire.\r\nJean doit récupérer la pierre dans un port à proximité de Bourré puis acheminer une moitié au port de la porte Ragueneau et l’autre moitié au pont Sainte-Anne.\r\nPour cela, il est remonté par le Cher depuis Montrichard et a rejoint la Loire. Il a ensuite longé Tours et les îles de Loire afin de rejoindre  le port de la porte ragueneau avant de retourner à La Riche au pont Sainte-Anne.	Vente par Jean Fournier, marinier à La Riche, à Guillaume Besnouart, maçon à Tours, de 500 pierres de Bourré à livrer avant Pâques par moitié au port de la porte Ragueneau et au pont Sainte-Anne, pour 100 s.t., en présence des témoins Jean Boyer et Jean Robin, laboureurs à Joué-lès-Tours.	16	15
3		Je m’appelle Jean Morier. Mes compagnons nautoniers et moi-même avons reçu une commande très importante de la part des charpentiers de Chambord. Nous devons livrer du bois pour l’édifice, il doit être de bonne qualité pour un tel château. Nous partons d’ici, le port de Saint Pierre des Corps ( N.B : la carte montre déjà le point) et nous devrons naviguer jusqu'à Saint Dyé sur Loire, non loin de Blois. Saint Dyé sur Loire est un port proche de Chambord, ce sera parfait. Nous ne prendrons pas de risque pour le bois et naviguerons sur les voies principales de la Loire entre nos deux ports. Ce qui est bien, c’est que si nous avons besoin d’un arrêt, de grandes villes sont sur notre chemin : notamment Blois, qui se trouve tout près de notre port d’arrivée. Allons y, les charpentiers de Chambord nous attendent.	Jean Morier, Robin Sicart et Heliot Queuloux (nautoniers) partent de Saint Pierre des Corps afin de livrer du bois à Saint Dyé sur Loire pour le compte de deux maîtres charpentiers (Etienne Hubert et Jean Procteny) travaillant à Chambord.	14	13
