9	Chaumont-sur-Loire	0101000020E610000054C8957A1604F33F439259BDC3BD4740	Situé entre Amboise et Blois, son bourg est situé d’un côté par la Loire. De l’autre côté sur le coteau surplombe un château féodal qui au 15ème siècle appartient à la famille d’Ambroise. Aujourd’hui il accueille le festival des jardins.	3
