11	Blois	0101000020E6100000572250FD8348F53FB35F77BAF3CA4740	Ville fortifiée au Moyen- Age,  Blois prospéra grâce au commerce fluvial des vins et d’eaux-de-vie. En 1498, le roi Louis XII l’éleva au rang de capitale de royaume. Blois demeura la résidence des rois et reines, dont François Ier, qui y établit sa bibliothèque. La ville restera fréquentée par la cour jusqu’à la mort de Catherine de Médicis en 1589.	3
12	Port de Gien	0101000020E61000009C8A54185B08054017BB7D5699D74740	Le commerce du bois a pendant longtemps été une source de revenus importante pour ce port. Il a aussi été appelé : le "port des ateliers à construire des chalands".	2
13	Saint-Pierre-des-Corps	0101000020E61000002D25CB4928FDE63F3883BF5FCCB24740	Situé à l’angle nord-est de l’enceinte du XIVe siècle, ce port est attesté en 1532 lorsque des pièces de charpente destinées au château de Chambord sont embarquées sur des bateaux pour rejoindre le port de Saint-Dyé-sur-Loire.	2
14	Saint-Dyé-Sur-Loire	0101000020E6100000C30E63D2DFCBF73F259529E620D44740	Prenant de l’importance grâce aux pèlerinages, la ville fortifiée de Saint-Dyé se dote d’un petit port avec la construction du château de Chambord qui débuta en 1519 et qui durera plus d’un siècle. Le chantier de Chambord fut l’un des plus importants de la Renaissance. Environ 220 000 tonnes de pierres sont nécessaires, acheminées par chariots du port de Saint-Dyé.	2
